function Get-FileHashes
{
    param($Path)
        $childFolders = Get-ChildItem $path -Attributes d
        if($childFolders){
            foreach($childFolder in $childFolders)
            {
                Get-FileHashes -Path $childFolder.FullName
            }
        }
        Get-FileHash $path\* | Select-Object -Property Hash,@{Name='FileName'; Expression={$_.Path.Substring($_.Path.lastIndexOf('\') + 1)}},Path,@{Name='LastModified'; Expression={(Get-ChildItem $_.Path).LastWriteTime}}
}

import tmi from "tmi.js"

import './App.css'

import {Header} from "./components/Header.js";
import {TipButton} from "./components/TipButton.js";
import {useCallback, useEffect, useRef, useState} from "react";
import {Info} from "./components/Info.js";
import {Input} from "./components/Input.js";
import {Guide} from "./components/Guide.js";
import {IWord} from "./interfaces/IWord.js";
import {Words} from "./components/Words.js";
import {Completed} from "./components/Completed.js";

interface Challange {
    id?: string;
    name?: string;
    type?: string;
}


function App() {
    const [client, setClient] = useState(new tmi.Client({channels: ['mimbol']}));

    const [completed, setCompleted] = useState<boolean>(false);
    const [tries, setTries] = useState<number>(0);
    const [words, setWords] = useState<IWord[]>([]);
    const [winner, setWinner] = useState<string>("");
    const [wordURI, setWordURI] = useState("");

    const [challengeId, setChallengeId] = useState<string>("");
    const [challenge, setChallenge] = useState<Challange>({});

    useEffect(() => {
        console.log("challenge Effect:", challenge)
        setWordURI(
            "/api/get_score?challenge_id=" + challenge.id +
            "&user_id=" + localStorage.token +
            "&challenge_type=" + challenge.type
        )
    },  [challenge]);
    useEffect(() => {
        console.log("challengeId Effect:", challengeId)
        setWordURI(
            "/api/get_score?challenge_id=" + challenge.id +
            "&user_id=" + localStorage.token +
            "&challenge_type=" + challenge.type
        )
    },  [challengeId]);


    const updateChallenge = () => {
        if (challengeId){
            fetch("/api/get_challenge_info?challenge_id=" + challengeId)
                .then(r => r.json())
                .then(r => setChallenge(r))
                .then(() => fetch("/api/get_history?challenge_id="+challengeId+"&user_id="+localStorage.token))
                .then(r => r.json())
                .then(r => {
                    setWords(r.words);
                    setTries(r.tries);
                    setCompleted(r.completed);
                })
        }
    }

    const addWord = useCallback(
        (val: string, chatter : string = "") => {
            console.log("addWord", ":", wordURI,":",encodeURI("&word=" +val));
            fetch(wordURI +  encodeURI("&word=" +val)) // <<<<<<<<<<<------------------- ТУТ
                .then(r => r.json())
                .then(r => {
                    if (r.completed === true) {
                        setCompleted(r.completed);
                        setWinner(chatter)
                    }
                    if (r.error === false) {
                        setTries(l => l + 1);
                        setWords(l => [...l, {word: r.word, rank: r.rank}].sort((a, b) => a.rank - b.rank));
                    } else {
                        console.error(r.details);
                    }
                });
        },
        [wordURI],
    );


    const count = useRef(0);
    useEffect(() => {
        if (count.current !== 0) {
            console.log("Вроде бы, первый рендер");
            (async ()=>{
                if (localStorage.token === undefined) {
                    const initialize_session = await  fetch("/api/initialize_session")
                        .then(r => r.json())
                    localStorage.token = initialize_session.token
                }

                const last_challenge = await fetch("/api/get_last_challenge")
                    .then(r => r.json())
                setChallengeId(last_challenge.id)
                updateChallenge()

            })();

            client.connect();
            client.on('message', (channel, tags, message) => {
                // "Alca: Hello, World!"
                console.log(`${tags['display-name']}: ${message}`, challenge);
                addWord(message, tags['display-name'])
            });

            return () => {
                client.disconnect()
                console.log("Убийство хука")
            };
        }
        count.current++;
    }, []);

    useEffect(() => {
        updateChallenge();
        return () => {};
    }, [challengeId]);







    return (
        <div className="container">
            <Header/>
            {completed && <Completed gameId={challenge.name as string} tries={tries} winner={winner}/>}
            <TipButton/>
            <Info gameId={challenge.name as string} tries={tries}/>
            <Input onEnter={(val:string) =>{addWord(val, "")}}/>
            {tries <= 0 && <Guide/>}
            {tries > 0 && <Words words={words}/>}
        </div>
    )
}

export default App

