internal class Program
    {
        static void Main(string[] args)
        {
            bool isWorking = true;

            while (isWorking)
            {
                Battle battle = new Battle();

                if(battle.CreateBattle())
                {
                    Console.ReadKey();
                    Console.Clear();
                    battle.Fight();
                    battle.BattleResults();
                }
            }

            isWorking = false;
            Console.WriteLine("Ввели неправильного бойца");
        }
    }

    class Battle
    {
        private Fighter _firstFighter;
        private Fighter _secondFighter;
        private List<Fighter> _fighters = new List<Fighter>();

        public Battle()
        {
            _fighters.Add(new Turtle("Черепаха", 100, 95, 10));
            _fighters.Add(new Lion("Лев", 90, 50, 8));
            _fighters.Add(new Snake("Змея", 90, 50, 9));
            _fighters.Add(new Hawk("Ястреб", 100, 70, 10));
        }

        public void ShowFighters()
        {
            Console.WriteLine("Список всех игроков:");

            for (int i = 0; i < _fighters.Count; i++)
            {
                Console.Write($"{i + 1})");
                _fighters[i].ShowStats();
            }

        }

        public bool TryGetFighters(out Fighter fighter)
        {
            ShowFighters();

            Console.WriteLine("Выберите номер боица: ");

            bool isNumber = int.TryParse(Console.ReadLine(), out int index);

            if(isNumber == false)
            {
                Console.WriteLine("Неправильный ввод");
                fighter = null;
            }
            else if(index > 0 && index -1 < _fighters.Count)
            {
                fighter = _fighters[index - 1];
                _fighters.Remove(fighter);
                return true;
            }
            else
            {
                Console.WriteLine("Такого бойца не существует.");
                fighter = null;
            }

            return false;
        }

        public bool CreateBattle()
        {
            Console.WriteLine("\nВведите первого бойца: ");
            TryGetFighters(out _firstFighter);
            Console.WriteLine("\nВведите второго бойца: ");
            TryGetFighters(out _secondFighter);

            if(_firstFighter == null || _secondFighter == null)
            {
                Console.WriteLine("Таких бойцов нету.");
                return false;
            }
            else
            {
                Console.WriteLine("Бойцы выбраны!!Все готовы к сражению!?");
                Console.WriteLine("Нажмите любую клавишу для продолжения...");
                Console.ReadKey();
                return true;
            }

        }

        public void Fight()
        {
            while(_firstFighter.Health > 0 && _secondFighter.Health > 0)
            {
                Console.WriteLine("Бой начался");
                _firstFighter.ShowStats();
                _secondFighter.ShowStats();
                _firstFighter.TakeDamage(_secondFighter);
                _secondFighter.TakeDamage(_firstFighter);
                _firstFighter.UseSpecialAttack();
                _secondFighter.UseSpecialAttack();
                Console.ReadKey();
                Console.Clear();
            }
        }

        public void BattleResults()
        {
            if(_firstFighter.Health <= 0 && _secondFighter.Health <= 0)
            {
                Console.WriteLine("Битва окончена ничьей.");
            }
            else if(_firstFighter.Health <= 0)
            {
                Console.WriteLine($"{_secondFighter.Name} выйграл эту битву. Поздравляем!");
            }
            else if(_secondFighter.Health <= 0)
            {
                Console.WriteLine($"{_firstFighter.Name} выйграл эту битву. Поздравляем!");
            }
        }
    }

    class Fighter
    {
        public Fighter(string name, float health, float armor, float damage)
        {
            Name = name;
            Health = health;
            Armor = armor;
            Damage = damage;
        }

        private int _numberOfPercent = 100;

        public string Name { get; protected set; }

        public float Health { get; protected set; }

        public float Armor { get; protected set; }

        public float Damage { get; protected set; }

        public void ShowStats()
        {
            if(Health <= 0)
            {
                Console.WriteLine($"Боец {Name} проиграл бой.");
            }
            else
            {
                Console.WriteLine($"{Name}.\nЗдоровье: {Health}.\nУрон: {Damage}.\nБроня: {Armor}.");
                ShowSkill();
                Console.WriteLine("---------------------------------------------------");
            }
        }

        public void TakeDamage(Fighter damageFighter)
        {
            float finalDamage = 0;

            if (Armor == 0)
            {
                Health -= damageFighter.Damage;
            }
            else 
            {
                finalDamage = damageFighter.Damage;
                Armor -= finalDamage;
                Health -= finalDamage;
            }

            Console.WriteLine($"{Name} нанес ({damageFighter.Damage}) урона.");
        }

        public void UseSpecialAttack()
        {
            Random random = new Random();
            int maximumPower = 10;
            int minimumPower = 0;
            int chanceForPower = 5;
            int chanceToUsePower = random.Next(minimumPower ,maximumPower);

            if (chanceToUsePower >= chanceForPower)
            {
                ActivatePower();
            }

        }

        protected virtual void ActivatePower() { }
        protected virtual void ShowSkill() { }
    }

    class Turtle : Fighter
    {
        private int _minHealth = 30;
        private int _addArmor = 40;

        public Turtle(string name, float health, float armor, float damage) : base(name, health, armor, damage) { }

        protected override void ActivatePower()
        {
            if(Health <= _minHealth)
            {
                Armor += _addArmor;

                Console.WriteLine($"У {Name} сработало уменее.");
            }
        }

        protected override void ShowSkill()
        {
            Console.WriteLine($"Умение: Если у бойца здоровье < 30, то прибавляется к армору + {_addArmor}");
        }
    }

    class Lion : Fighter
    {
        private int _minHealth = 30;
        private int _addHealth = 5;
        private int _addArmor = 5;
        public Lion(string name, float health, float armor, float damage) : base(name, health, armor, damage) { }

        protected override void ActivatePower()
        {
            if(Health <= _minHealth)
            {
                Health += _addHealth;
                Armor += _addArmor;

                Console.WriteLine($"У {Name} сработало уменее.");
            }
        }

        protected override void ShowSkill()
        {
            Console.WriteLine($"Умение: Если у бойца здоровье < 20, то прибавляется к армору + {_addArmor},к здоровью + {_addHealth}");
        }
    }

    class Snake : Fighter
    {
        private int _addDamage = 15;
        public Snake(string name, float health, float armor, float damage) : base(name, health, armor, damage) { }

        protected override void ActivatePower()
        {
            if (Health <= 50)
            {
                Damage += _addDamage;

                Console.WriteLine($"У {Name} сработало уменее.");
            }
        }

        protected override void ShowSkill()
        {
            Console.WriteLine($"Умение: Если у бойца здоровье < 50, то прибавляется к атаке + {_addDamage}");
        }
    }

    class Hawk : Fighter
    {
        private int _addDamage = 10;
        private int _addArmor = 5;

        public Hawk(string name, float health, float armor, float damage) : base(name, health, armor, damage) { }

        protected override void ActivatePower()
        {
            if (Health <= 40)
            {
                Damage += _addDamage;
                Armor += _addArmor;

                Console.WriteLine($"У {Name} сработало уменее.");
            }
        }

        protected override void ShowSkill()
        {
            Console.WriteLine($"Умение: Если у бойца здоровье < 50, то прибавляется к атаке + {_addDamage} и к армору + {_addArmor}");
        }
    }

