int make_xor(int n, int m, int k) {
    int ans = 0;
    for (int i = 0; i < n; ++i) {
        ans ^= 2;
    }
    for (int i = 0; i < m; ++i) {
        ans ^= 3;
    }
    ans ^= k;
    return ans;
}

