array<int, MAXN> used;

void build(int v) {
    int cnt = 0;
    if (v % 3 == 0) {
        if (v >= 1) {
            if (used[v - 1] == -1) {
                build(v - 1);
            }
            cnt += (used[v - 1] == 0);
