                build(v - 1);
            }
            cnt += (used[v - 1] == 0);
        }
        if (v >= 3) {
            if (used[v - 3] == -1) {
                build(v - 3);
            }
            cnt += (used[v - 3] == 0);
        }
    }
    if (v % 3 == 2) {
        if (v >= 1) {
            if (used[v - 1] == -1) {
                build(v - 1);
            }
            cnt += (used[v - 1] == 0);
        }
        if (v >= 2) {
            if (used[v - 2] == -1) {
                build(v - 2);
            }
            cnt += (used[v - 2] == 0);
        }
        if (v >= 3) {
            if (used[v - 3] == -1) {
                build(v - 3);
            }
            cnt += (used[v - 3] == 0);
        }
    }
    used[v] = (cnt > 0 ? 1 : 0);
}

