public static boolean sendRedirectIfRobot(HttpServletRequest request, HttpServletResponse response) {
   UserAgent userAgent = UserAgent.get(request);
   if (!userAgent.isRobot())
     return false ;
   logger.warn("Robot requests must be rejected (robot={})" , userAgent.getName());
   try {
     GlobalMessages.getInstance(request).error("error.robot.access.denied" ,new Object[0]);
     response.sendRedirect(request.getContextPath() + "/permissionDenied.do");
   } catch (Throwable ignored) {
     logger.warn("Exception when denying access" , ignored);
   }
   returntrue;
 }

 public static Optional<ActionForward> forwardIfRobot(HttpServletRequest request) {
   UserAgent userAgent = UserAgent.get(request);
   if (!userAgent.isRobot())
     return Optional.empty();
   logger.warn("Robot requests must be rejected (robot={})" , userAgent.getName());
   GlobalMessages.getInstance(request).error("error.robot.access.denied" ,new Object[0]);
   return Optional.of(new ActionForward("/permissionDenied.do"));
 }

