#include <stdio.h>
#include <string.h>

// These 3 functions are basically stolen from https://www.geeksforgeeks.org/convert-base-decimal-vice-versa/
// I modified them a bit to make it more readable for beginners.

// To return char for a value. It supports upto base 16 digit.
// For example '2' is returned for 2.
// 'A' is returned for 10. 'B' for 11
char convertDigitToChar(int num)
{
    if (num >= 0 && num <= 9)
        return (char)(num + '0');
    else
        return (char)(num - 10 + 'A');
}

// Utility function to reverse a string
void reverseString(char *str)
{
  int len = strlen(str);
  int i;
  for (i = 0; i < len / 2; i++)
  {
    char temp = str[i];
    str[i] = str[len - i - 1];
    str[len - i - 1] = temp;
  }
}

// Function to convert a given decimal number to any base you want
void convertDecimalToAnyBase(char output[], int base, int decimal)
{
  int index = 0; // Initialize index of result

  // Input decimal is repeatedly divided by base and its remainder is stored in output[]
  while (decimal > 0)
  {
    output[index++] = convertDigitToChar(decimal % base);
    decimal /= base;
  }
  output[index] = '\0';

  // We need to reverse output string to get properly formatted result
  reverseString(output);  // this won't reverse the null terminator
}

int main(void)
{
  // read 8 characters from stdin
  char c[9]; // 8 characters + null terminator
  printf("Enter 8 binary digits: ");
  scanf("%8s", c);

  // convert characters to binary digits
  int b[8];
  for (int i = 0; i < 8; i++)
  {
    b[i] = c[i] - '0';
  }

  // validate binary digits
  for (int i = 0; i < 8; i++)
  {
    if (b[i] != 0 && b[i] != 1)
    {
      printf("Error: Digit must be 0 or 1.\n");
      return 1;
    }
  }

  // store binary digits in an integer by setting the last 8 bits;
  // think of an integer as a 32-bit binary number with leading zeros;
  // we are trying to set the last 8 bits of the integer;
  // for example, if the input binary digits are 10101010, then
  // the integer will be 00000000000000000000000010101010
  int decimal = 0;
  for (int i = 0; i < 8; i++)
  {
    decimal |= b[7 - i] << i; // set one bit at a time, starting from the right
  }

  // print base 10
  printf("Decimal: %d\n", decimal);

  // print base 8
  char octal[10];
  convertDecimalToAnyBase(octal, 8, decimal);
  printf("Octal: %s\n", octal);

  // print base 16
  char hex[10];
  convertDecimalToAnyBase(hex, 16, decimal);
  printf("Hexadecimal: %s\n", hex);
  return 0;
}

